import './Chart.css';
import ChartBar from './ChartBar';

const Chart = (props) => {

    //
    let dataPointValues = props.dataPoints.map((dp) => dp.value);
    let maxVal = Math.max(...dataPointValues);

    return(
    <div className='chart'>
        <ChartBar key={props.dataPoints.label} value={props.dataPoints.value} label={props.dataPoints.label} maxValue={maxVal}/>
    </div>)
    ;
}

export default Chart;
